(1, 'Auktion einladen (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Einladung zur Auktion für die Premium Domain [[domain]]', '<div class=\"col-sm-2\">\r\n                            <p>[[anrede-nachname]],</p>\r\n                            <p>Sie hatten vor einiger Zeit Interesse daran, die Premium Domain [[domain]] auf der Handelsplattform von Adomino zu erwerben. Der Inhaber der Domain hat sich k&uuml;rzlich dazu entschlossen die Domain &uuml;ber unsere neu entwickelte Auktionsplattform versteigern zu lassen.<br /><br />Die Auktion startet am [[auktion-startzeit]] und endet voraussichtlich am [[auktion-endzeit]], sofern kein Bieter die Domain mittels der Sofortkauf-Option vorzeitig kauft.&nbsp; Falls Sie nach wie vor an der Domain [[domain]] interessiert sind, k&ouml;nnte dies Ihre letzte Chance sein, die Domain zu erwerben!<br /><br />Sie m&ouml;chten sich diese Auktion ansehen oder mitbieten? Dann geben Sie einfach www.[[domain]] in Ihren Browser ein. Die Erkl&auml;rung des Auktionsablaufes finden Sie hier: www.adomino.net/de/ablauf/.</p>\r\n                            <p>Interessant d&uuml;rfte f&uuml;r Sie vielleicht auch sein, dass die Domain wohnungen.de&nbsp; um 200.000 EUR netto&nbsp; im Dezember 2019 von uns verkauft wurde.</p>\r\n                            <p><br />Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\r\n                            <p>____________________________________</p>\r\n                            <p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\r\n                            <p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\r\n                            <p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\r\n                            <p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>\r\n                            </div>', 1, 'invitation', '[\"[[domain]]\", \"[[anrede-nachname]]\", \"[[auktion-startzeit]]\", \"[[auktion-endzeit]]\", \"[[auktion-startpreis]]\", \"[[auktion-endpreis]]\", \"[[auktion-tage]]\", \"[[auktion-schritt]]\", \"[[vkpreis]]\"]', 0, 'de', '2021-12-26 04:56:13', '2021-12-26 04:56:13', NULL),
(2, 'Auktion einladen (Englisch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Einladung zur Auktion für die Domain [[domain]]', '<p>Content can be saved with saved button at bottom</p>', 0, 'invitation', '[\"[[domain]]\", \"[[anrede-nachname]]\", \"[[auktion-startzeit]]\", \"[[auktion-endzeit]]\", \"[[auktion-startpreis]]\", \"[[auktion-endpreis]]\", \"[[auktion-tage]]\", \"[[auktion-schritt]]\", \"[[vkpreis]]\"]', 1, 'en', '2021-12-26 04:56:13', '2021-12-26 04:56:13', NULL),
(3, 'Angebot (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Angebot Domain [[domain]]', '<p>[[anredeUndNachname]],</p>\r\n                            <p>zun&auml;chst bedanken wir uns f&uuml;r Ihre Anfrage am Erwerb der Premium-Domain [[domain]].</p>\r\n                            <p>Ganz gleich ob in der Suchmaschine, eine Werbeschaltung bei Google, ein Inserat in einer Zeitung oder Plakatwerbung, der Domainname ist h&auml;ufig die erste Verbindung mit dem zuk&uuml;nftigen Interessenten. Beschreibende Premium-Domainnamen sorgen von Beginn an wie bei einem bekannten Markenprodukt f&uuml;r einen vertrauensw&uuml;rdigen und kompetenten Eindruck. Dadurch lassen sich h&ouml;here Klickraten bei Google AdWords Kampagnen erzielen, die zusammen durch den leicht merkbaren Domainnamen zu geringeren Marketingkosten f&uuml;hren.</p>\r\n                            <p>Wir, die DAY Investments GmbH haben dies bereits im Jahr 1999 erkannt und investieren deshalb selbst seit dem in beschreibende Domainnamen. Dadurch z&auml;hlen wir nun zu den bekanntesten und erfolgreichsten Domaininvestoren im deutschsprachigen Raum mit derzeit &uuml;ber 10.000 Premium-Domains wie autos.de, wohnung.de, werbung.de, fotos.de, webdesign.de oder auch internationale Domains wie witz.com, suchen.com, routenplaner.com oder pda.net. &nbsp;Zu unseren Kunden z&auml;hlen bekannte Firmen wie McDonald&acute;s, Microsoft, Saturn/Media-Markt, Dr. Oetker, SKY, OBI, Stadt Wien, Kraft Foods, Kronen-Zeitung, &nbsp;S&uuml;dwestrundfunk, OE24.at oder Swisscom.</p>\r\n                            <p>Basis unserer automatisierten Domainbewertung f&uuml;r die Premium-Domain [[domain]] sind prim&auml;r das Domainalter, der Eigentraffic der Domain (TypeIns), der Wert des Keywords in Suchmaschinen (Cost per Click) sowie die Anzahl der bisherigen Kaufinteressenten und deren Preisvorstellungen.&nbsp;</p>\r\n                            <p>Unsere Bewertung der Domain [[domain]] ergab einen Wert von [[vkpreis]] Euro (netto). Das Angebot ist 14 Tage g&uuml;ltig. Da wir auch durchwegs mit anderen Interessenten gleichzeitig in Verbindung stehen, k&ouml;nnen wir Ihnen die Domain [[domain]] nur unverbindlich anbieten. (First Come First Serve Prinzip). Irrt&uuml;mer vorbehalten.</p>\r\n                            <p>Gerne k&ouml;nnen Sie uns auch Ihre Preisvorstellung mitteilen, da es sich bei dem genannten Preis um keinen Fixpreis sondern um einen branchen&uuml;blichen Verhandlungsbasis-Preis handelt und wir auch gerne bereit sind, &uuml;ber den Preis mit Ihnen zu sprechen. Falls Ihre Preisvorstellungen weit unter unseren Preisvorstellungen liegen, bieten wir vereinzelt auch eine Domainauktion auf der neu entwickelten Auktionsplattform www.adomino.net an. Falls Sie Kaufinteresse an der Domain [[domain]] haben sollten, reservieren wir auf Anfrage gerne die Domain f&uuml;r maximal 14 Tage.&nbsp;</p>\r\n                            <p>Ich hoffe Ihnen mit diesen Informationen behilflich gewesen zu sein und freue mich auf Ihre Antwort. Bei weiteren Fragen stehe ich Ihnen gerne zur Verf&uuml;gung.</p>\r\n                            <p>Mit freundlichen Gr&uuml;&szlig;en</p>\r\n                            <p>Eur.Ing. Harald Hochmann<br />Gesch&auml;ftsf&uuml;hrer&nbsp;</p>\r\n                            <p>DAY Investments GmbH<br />Millennium Tower, 23. Stock<br />Handelskai 94-96<br />A-1200 Wien<br />&Ouml;sterreich</p>\r\n                            <p>Tel: +43 (1) 333 45 - 8555<br />Fax: +43 (1) 333 45 - 8585<br />Mail: hochmann@day.eu<br />Web: http://www.day.eu</p>\r\n                            <p>UID: AT U57657912<br />FimenbuchNr: FN 242524d, Wien<br />Gerichtsstand: Wien<br />Gesch&auml;ftsf&uuml;hrer: Harald Hochmann, Marcus Hofer</p>', 0, 'offer', '[\"[[domain]]\", \"[[anredeUndNachname]]\", \"[[vkpreis]]\"]', 2, 'de', '2021-12-26 04:56:13', '2021-12-26 04:56:13', NULL),
(4, 'Angebot (Englisch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Offer domain [[domain]]', '<p>Hello!</p>\r\n                            <p>First of all, we thank you for your request to purchase the premium domain [[domain]].</p>\r\n                            <p>Regardless of whether it is in the search engine, an advertisement on Google, an advertisement in a newspaper or a poster, the domain name is often the first contact with the prospective customer. Generic premium domain names ensure a trustworthy and competent impression right from the start, as with a well-known branded product. As a result, higher click rates can be achieved with Google AdWords campaigns, which together lead to lower marketing costs due to the easily remembered domain name.</p>\r\n                            <p>We recognized this in 1999 and have therefore been investing in generic domain names since then. As a result, we are now one of the best-known and most successful domain investors in German-speaking countries with currently over 10,000 premium domains such as autos.de ,wohnung.de, werbung.de, fotos.de, webdesign.de or international domains such as witz.com .com, routenplaner.com or pda.net. Our customers include well-known companies such as McDonald\'s, Microsoft, Saturn / Media-Markt, Dr. Oetker, SKY, OBI, City of Vienna, Kraft Foods, Kronen-Zeitung, S&uuml;dwestrundfunk, OE24.at or Swisscom.</p>\r\n                            <p>The basis of our automated domain evaluation for the premium domain [[domain]] is primarily the domain age, the domain\'s own traffic (Type-Ins), the value of the keyword in search engines (cost per click) as well as the number of previous potential buyers and their price expectations.</p>\r\n                            <p>Our assessment of the [[domain]] domain resulted in a value of [[vkpreis]] Euro (excluding tax). The offer is valid for 14 days. Since we are also in contact with other interested parties at the same time, we can only offer you the [[domain]] domain without obligation. (First Come First Serve principle). Errors excepted.</p>\r\n                            <p>You are also welcome to tell us your asking price, as the price mentioned is not a fixed price but a negotiation base price customary in the industry and we are also happy to talk to you about the price. If your asking price is far below our asking price, we occasionally also offer a domain auction on the newly developed auction platform www.adomino.net. If you are interested in buying the domain [[domain]], we will be happy to reserve the domain on request for a maximum of 14 days.</p>\r\n                            <p>I hope that this information has been helpful to you and I look forward to your reply. For further information do not hesitate to contact me.</p>\r\n                            <p>Best regards,</p>\r\n                            <p>Harald Hochmann<br />Managing Director &nbsp;</p>\r\n                            <p>DAY Investments GmbH<br />Millennium Tower<br />Handelskai 94-96<br />1200 Vienna<br />Austria</p>\r\n                            <p>Tel: +43 (1) 333 45 &ndash; 8555<br />Fax: +43 (1) 333 45 &ndash; 8585<br />Mail: hochmann@day.eu<br />Web: http://www.day.eu</p>', 0, 'offer', '[\"[[domain]]\", \"[[anredeUndNachname]]\", \"[[vkpreis]]\"]', 3, 'en', '2021-12-26 04:56:13', '2021-12-26 04:56:13', NULL),
(5, 'PIN-Code (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net PIN-Code', '<p><span lang=\"DE-AT\">[[anrede-nachname]],<br /><br />Bitte geben Sie den PIN-Code ein um die Registrierung abzuschlie&szlig;en.</span></p>\r\n<p><span lang=\"DE-AT\">PIN-Code:&nbsp; </span>[[pin-code]]</p>\r\n<p><span lang=\"DE-AT\">Der PIN-Code ist nur 10 Minuten g&uuml;ltig.</span></p>\r\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\r\n<p>____________________________________</p>\r\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\r\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\r\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\r\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>\r\n<p>&nbsp;</p>', 0, 'registration', '[\"[[pin-code]]\", \" [[anrede-nachname]]\"]', 4, 'de', '2021-12-26 04:56:13', '2022-01-05 19:51:43', NULL),
(6, 'Zertifizierung Level 4 OK (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net Zertifizierung Level 4 Antrag', '<p>[[anrede-nachname]],</p>\r\n<p>Die &Uuml;berpr&uuml;fung Ihres Dokumentes war erfolgreich. Sie sind nun f&uuml;r Level 4 freigeschalten.</p>\r\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\r\n<p>____________________________________</p>\r\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\r\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\r\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\r\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>', 0, 'registration', 'null', 5, 'de', '2021-12-26 04:56:13', '2022-01-05 19:52:25', NULL),
(7, 'Zertifizierung Level 4 Fehler (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net Zertifizierung Level 4 Antrag', '<p>[[anrede-nachname]],<br /><br />Die Pr&uuml;fung Ihres Dokumentes war leider nicht erfolgreich. Bitte laden Sie Ihren g&uuml;ltigen und gut lesbaren Reisepass oder Reisepass im PDF oder JPG-Format auf unseren Server um f&uuml;r Level 4 freigeschalten werden zu k&ouml;nnen.</p>\r\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\r\n<p>____________________________________</p>\r\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\r\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\r\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\r\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>', 0, 'registration', 'null', 6, 'de', '2021-12-26 04:56:13', '2022-01-05 19:50:58', NULL),
(8, 'Glückwunsch Domainkauf (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Ihr Kauf der Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Wir begl&uuml;ckw&uuml;nschen Sie zum Kauf der Domain [[domain]] zum Preis von [[vkpreis]] EUR (netto). Sie werden von uns ein gesondertes E-Mail mit der Rechnung und weiteren Instruktionen &uuml;ber den Transfer erhalten.</p>\r\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\r\n<p>____________________________________</p>\r\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\r\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\r\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\r\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>', 0, 'auction', '[\"[[domain]]\", \"[[vkpreis]]\", \" [[anrede-nachname]]\"]', 7, 'de', '2021-12-26 04:56:13', '2022-01-05 19:53:09', NULL),
(9, 'Anderer Bieter Domain gekauft (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Ihr Gebot für die Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Ein anderer Bieter hat die Domain [[domain]] gerade gekauft. Es tut uns sehr leid, dass Sie f&uuml;r die Domain nicht H&ouml;chstbieter waren. Die Auktion ist somit beendet.</p>\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\n<p>____________________________________</p>\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>', 0, 'auction', '[\"[[domain]]\", \"[[vkpreis]]\", \" [[anrede-nachname]]\"]', 8, 'de', '2021-12-26 04:56:13', '2022-01-05 19:53:28', NULL),
(10, 'Watchlist - Anderer Interessent in Watchlist hinzugefügt (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Watchlist für die Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Ein anderer Interessent hat die Domain &nbsp;[[domain]] in seine Watchlist hinzugef&uuml;gt. Bitte beachten Sie, dass die Auktion auch vorzeitig beendet werden k&ouml;nnte, sobald ein Bieter die Domain sofort kauft. In diesem Fall wird die Auktion sofort beendet. Sofern Sie keine weiteren Watchlist-E-Mails f&uuml;r diese Domain erhalten wollen, k&ouml;nnen Sie die Domain in adomino.net aus Ihrer Watchlist wieder entfernen.</p>\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\n<p>____________________________________</p>\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>', 0, 'auction', '[\"[[domain]]\", \" [[anrede-nachname]]\"]', 11, 'de', '2021-12-26 04:56:13', '2022-01-05 19:53:47', NULL),
(11, 'Watchlist - Anderer Interessent in Favoriten hinzugefügt (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Watchlist für die Domain [[domain]]', '<p><span lang=\"DE-AT\">[[anrede-nachname]],<br /><br />Ein anderer Interessent hat die Domain [[domain]] in seine Favoriten hinzugef&uuml;gt. Bitte beachten Sie, dass die Auktion auch vorzeitig beendet werden k&ouml;nnte, sobald ein Bieter die Domain sofort kauft. In diesem Fall wird die Auktion sofort beendet.Sofern Sie keine weiteren Watchlist-E-Mails f&uuml;r diese Domain erhalten wollen, k&ouml;nnen Sie die Domain in adomino.net aus Ihrer Watchlist wieder entfernen.</span></p>\n<p>Mit&nbsp;freundlichen&nbsp;Gr&uuml;&szlig;en<br />Ihr Adomino Team</p>\n<p>____________________________________</p>\n<p>DAY Investments Ltd.<br />6 Clayton Street<br />Newmarket<br />Auckland 1023<br />Neuseeland</p>\n<p>Web: www.adomino.net<br />E-Mail: office@DAY.kiwi<br />Telefon: +64 9 928 1385<br />Telefax : +43 1 333 45 8585</p>\n<p>Steuernummer: 125-934-966<br />Firmenregister: 6582253</p>\n<p>Direktoren:<br />Eur. Ing. Harald Hochmann und Tim Johnson</p>', 0, 'auction', '[\"[[domain]]\", \" [[anrede-nachname]]\"]', 12, 'de', '2021-12-26 04:56:13', '2022-01-05 19:54:11', NULL),
