(15, 'Watchlist - Bieter Gebot abgegeben (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Watchlist für die Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Ein Bieter hat für die Domain [[domain]] gerade ein Gebot abgegeben. Bitte beachten Sie, dass die Auktion auch vorzeitig beendet werden könnte, sobald ein Bieter die Domain sofort kauft. In diesem Fall wird die Auktion sofort beendet. Sofern Sie keine weiteren Watchlist-E-Mails für diese Domain erhalten wollen, können Sie die Domain in adomino.net aus Ihrer Watchlist wieder entfernen.</p>', 0, 'auction', '[\"[[domain]]\", \"[[gebotspreis]]\", \" [[anrede-nachname]]\"]', 16, 'de', NULL, NULL, NULL),
(16, 'Gebot abgegeben (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Ihr Gebot für die Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Wir bestätigen Ihnen, dass Sie für die Domain [[domain]] ein Gebot über [[gebotspreis]] EUR (netto) abgegeben haben. Sollten Sie von einem anderen Bieter überboten werden, erhalten Sie von uns ein weiteres E-Mail.</p>', 0, 'auction', '[\"[[domain]]\", \"[[gebotspreis]]\", \" [[anrede-nachname]]\"]', 9, 'de', NULL, NULL, NULL),
(17, 'Wurde überboten (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Sie wurden überboten für die Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Wir müssen Ihnen leider mitteilen, dass Sie für die Domain if.nz überboten wurden. Sie haben jedoch im Bietmanager die Möglichkeit, das Gebot des anderen Bieters zu überbieten oder die Domain sofort zu kaufen.</p>', 0, 'auction', '[\"[[domain]]\", \"[[gebotspreis]]\", \" [[anrede-nachname]]\"]', 10, 'de', NULL, NULL, NULL),
(18, 'Watchlist–Auktion gestartet (Deutsch)', 'DAY Investments GmbH', 'office@adomino.net', 'cc@day.eu', 'Adomino.net: Watchlist: Start der Auktion für die Domain [[domain]]', '<p>[[anrede-nachname]],<br /><br />Die Auktion für die Domain [[domain]] wurde gestartet. Bitte beachten Sie, dass die Auktion auch vorzeitig enden kann, sobald ein Bieter die Domain sofort kauft. In diesem Fall wird die Auktion sofort beendet. Wenn Sie keine weiteren Watchlist-E-Mails für diese Domain erhalten möchten, können Sie die Domain in adomino.net von Ihrer Watchlist entfernen.</p>', 0, 'auction', '[\"[[domain]]\", \" [[anrede-nachname]]\" , \"[[startdatum]]\", \"[[enddatum]]\",\"[[startpreis]]\", \"[[endendpreis]]\"]', 17, 'de', '2022-03-03 09:23:47', NULL, NULL);
